    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Upper Ouachita and Handy Brake NWRs for the next
    15 years. This plan outlines the refuges' vision and purpose and describes how Upper
    Ouachita and Handy Brake NWRs will contribute to the overall mission of the Refuge
    System. The plan provides an introduction to the refuges, an overview of the CCP
    process, information on plan development and management direction, and strategies
    for plan implementation. Key planning issues include: fish and wildlife population
    management, habitat management, resource protection, visitor services, and Refuge
    administration.",nt"license_title": "License Not Specified",nt"extras":
